import React, { useEffect, useState } from 'react';
import { getAll } from "../api/projects";
import TableBody from "../components/projects/TableBody";
import Table from "../components/Table";

export default function Projects() {
    const [data, setData] = useState([]);

    const fetchProjects = () => {
      return getAll()
        .then((res) => res.json())
        .then((d) => setData(d))
    }


    useEffect(() => {
        fetchProjects();
    }, []);
    const projects = getAll();
    const tableHeaders = [
        "#",
        "Name",
		"DeadLine",
		"TimePerWeek",
		"TotalTimeSpent",
		"IsCompleted",
    ];
    debugger;
    const tableBody = <TableBody data={projects}/>
    return (
        <>
            <div className="flex items-center my-6">
                <div className="w-1/2">
                    <button className="bg-blue-500 hover:bg-blue-700 text-white font-bold py-2 px-4 rounded">
                        Add entry
                    </button>
                </div>

                <div className="w-1/2 flex justify-end">
                    <form>
                        <input
                            className="border rounded-full py-2 px-4"
                            type="search"
                            placeholder="Search"
                            aria-label="Search"
                        />
                        <button
                            className="bg-blue-500 hover:bg-blue-700 text-white rounded-full py-2 px-4 ml-2"
                            type="submit"
                        >
                            Search
                        </button>
                    </form>
                </div>
            </div>

            <Table headers={tableHeaders} body={tableBody}/>
        </>
    );
}
